e of the contact flow, choose <b>Show additional flow information</b>. The ContactFlowId is the last part of the ARN, shown here in bold: </p> <p>arn:aws:connect:us-west-2:xxxxxxxxxxxx:instance/xxxxxxxx-xxxx-xxxx-xxxx-xxxxxxxxxxxx/contact-flow/<b>846ec553-a005-41c0-8341-xxxxxxxxxxxx</b> </p>', ], ], 'ContactFlowName' => [ 'base' => NULL, 'refs' => [ 'ContactFlowSummary$Name' => '<p>The name of the contact flow.</p>', ], ], 'ContactFlowSummary' => [ 'base' => '<p>Contains summary information about a contact flow.</p>', 'refs' => [ 'ContactFlowSummaryList$member' => NULL, ], ], 'ContactFlowSummaryList' => [ 'base' => NULL, 'refs' => [ 'ListContactFlowsResponse$ContactFlowSummaryList' => '<p>Information about the contact flows.</p>', ], ], 'ContactFlowType' => [ 'base' => NULL, 'refs' => [ 'ContactFlowSummary$ContactFlowType' => '<p>The type of contact flow.</p>', 'ContactFlowTypes$member' => NULL, ], ], 'ContactFlowTypes' => [ 'base' => NULL, 'refs' => [ 'ListContactFlowsRequest$ContactFlowTypes' => '<p>The type of contact flow.</p>', ], ], 'ContactId' => [ 'base' => NULL, 'refs' => [ 'GetContactAttributesRequest$InitialContactId' => '<p>The identifier of the initial contact.</p>', 'StartChatContactResponse$ContactId' => '<p>The identifier of this contact within the Amazon Connect instance. </p>', 'StartOutboundVoiceContactResponse$ContactId' => '<p>The identifier of this contact within the Amazon Connect instance.</p>', 'StopContactRequest$ContactId' => '<p>The ID of the contact.</p>', 'UpdateContactAttributesRequest$InitialContactId' => '<p>The identifier of the contact. This is the identifier of the contact associated with the first interaction with the contact center.</p>', ], ], 'ContactNotFoundException' => [ 'base' => '<p>The contact with the specified ID is not active or does not exist.</p>', 'refs' => [], ], 'CreateUserRequest' => [ 'base' => NULL, 'refs' => [], ], 'CreateUserResponse' => [ 'base' => NULL, 'refs' => [], ], 'Credentials' => [ 'base' => '<p>Con